const mapImage = (src) => `https://ipfs.near.social/ipfs/${src}`;

const Container = styled.div`
  max-width: 90rem;
  margin: 0 auto;
  display: flex;
  flex-direction: column;
  gap: 3rem;

  & > div {
    width: 100%;
  }
`;

const DoubleItem = styled.div`
  display: flex;
  padding: 0rem 0rem 1.5rem 0rem;
  align-items: center;
  gap: 1.375rem;

  & > div {
    width: 50%;
  }
`;

const Section = styled.div`
  display: flex;
  padding: 0rem 0rem 1.5rem 0rem;
  align-items: center;
  gap: 1.375rem;

  & > div {
    width: 100%;
  }
`;

const Footer = styled.div``;

const Image = styled.img`
  width: 100%;
  height: 100%;
  object-fit: cover;
`;

const RegisterButton = styled.a`
  display: flex;
  padding: 0.75rem 1.875rem;
  justify-content: center;
  align-items: center;
  gap: 0.5rem;
  align-self: stretch;
  border-radius: 50px;
  background: var(--primary-primary-default, #00ec97);
  color: var(--text-text-dark, #11181c);
  text-align: center;
  font-size: 1.125rem;
  font-family: Inter;
  font-weight: 600;

  &:hover,
  &:focus,
  &:active {
    background: var(--primary-primary-hover, #00ec97);
    color: var(--text-text-dark, #11181c);
    text-decoration: none;
  }
`;

const registerButton = ({ text, href }) => (
  <RegisterButton href={href ?? `${ownerId}/widget/Index?tab=createproject`}>
    {text}
  </RegisterButton>
);

